import React from 'react'
import { useParams } from 'react-router-dom'

export default function Detail() {
  const [id, name, msg] = useParams()
  return (
    <div>
      <ul>
        <li>{id}</li>
        <li>{name}</li>
        <li>{msg}</li>
      </ul>
    </div>
  )
}
